import React, { useContext } from 'react';
import { Link, NavLink, withRouter } from 'react-router-dom';

const Navbar = () => {
    return (
        <div>
            <nav>
                <h1>NAVBAR</h1>
                <ul>
                    <li><NavLink to="/movies">Movies</NavLink></li>
                    <li><NavLink to="/">TV Shows</NavLink></li>
                </ul>
            </nav>
        </div>
    );
}

export default withRouter(Navbar);
